import classes from "./FoodList.module.css";

const FoodList = () => {
  const defaultFood = [
    {
      title: "Fries With Chicken ðŸ”¥ cheese burger",
      price: 25.14,
    },
    { title: "Pizza with Leaves And StrawBerry", price: 19.28 },
    { title: "Beef Cheese Burher ðŸ”¥ with sausages", price: 43.12 },
    { title: "Hungry Meal with burger and fries nd sausages", price: 14.22 },
  ];

  const lists = defaultFood.map((food) => (
    <li>
      <p>{food.title}</p>
      <p>{food.price}</p>
    </li>
  ));

  return (
    <div>
      <ul className={classes.ul}>{lists}</ul>
    </div>
  );
};

export default FoodList;
